import React, { useState, useEffect } from 'react';
import tailwind from 'tailwind-rn';
import FormButton from "../../Form/FormButton";
import * as actions from "../../../Actions/medicalService";
import { connect } from "react-redux";
import { TouchableOpacity,View, Text, StyleSheet } from 'react-native';
//import 'localstorage-polyfill';
import '../home.css';
import "../login1.css";
const AntecedentsList = (props) => {
  const [display, setDiplay] = useState(false);
  let config = {
      num: [4, 7],
      rps: 0.1,
      radius: [5, 40],
      life: [1.5, 3],
      v: [2, 3],
      tha: [-50, 50],
      alpha: [0.6, 0],
      scale: [.1, 0.9],
      position: "all",
      color: [ "#ff0000"],
      cross: "dead",
      random: 10
    };
    const test =props.patientList.examBio;
  return (
<div>
      <div className="bg-image"></div>
      <div className="bg-text">
      <View style={tailwind(' items-center ')} >
        <Text style={tailwind('text-gray-200 font-bold py-2 text-xl text-center')}>Examen biologique:</Text>

        <div>

    {Object.keys(test).map((setNom, key) => (<div> 
        <h1>{setNom}</h1>
      <div >
        {setNom=="nfs" &&  <div> {Object.keys(test[setNom]).map((key1, key2) => (<div> 
                          <Text >{JSON.stringify(test[setNom]["gbs"])}</Text>   
                          </div>))}</div>

      }

    </div> 
  </div>

        ))
}
  </div>
        <View style={styles.row}>
          <FormButton title="Retour" onPress={() => props.navigation.navigate("AntecendentsMedicaux")} />
          <FormButton title=" Ajouter un antécedent médical" onPress={() => props.navigation.navigate("AddAntecendentsMedicaux")} />

        </View>

      </View>
      <div
          style={{ display: display ? "flex" : "none" }}
          className="flex justify-center align-middle my-4 p-2"
        >
        </div>

      </div>
    </div>
  );
};
const styles = StyleSheet.create({
  row: {
    flex: 1,
    flexDirection: "row",
    padding: 10
  },
  body: {
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center',
    backgroundColor: '#2193b0',
  },
});

const mapStateToProps = (state) => ({
  patientList: state.medicalService.patientList,
});
const mapActionToProps = {
  delOneExamenBio: actions.delOneExamenBio
};

export default connect(mapStateToProps, mapActionToProps)(AntecedentsList);
